var tipuesearch = {"pages":[{"title":"About","text":"2016Fall 修課成員網誌","tags":"misc","url":"./pages/about/"},{"title":"40423128 電腦輔助機械設計總結","text":"40423128 9/29作業 心得 : 記過這幾週的課程讓我認識Solvespace 和 onshape這兩套繪圖軟體，版本更新與協同的操作","tags":"HW","url":"./40423128-dian-nao-fu-zhu-ji-jie-she-ji-zong-jie.html"},{"title":"40423128 12/27 onshape 3D列印機組裝作業","text":"3D列印機各部位零件組裝影片 底座裝配 上蓋 支架 線位開關 噴頭 支撐桿 平面 顯示器","tags":"onshape HW","url":"./40423128-1227-onshape-3dlie-yin-ji-zu-zhuang-zuo-ye.html"},{"title":"40423128  12/31 onshape 連桿組裝影片","text":"onshape連桿組零件一覽 onshape連桿組裝影片 2017 01 08 11 31 45 929 from Su Sam on Vimeo .","tags":"onshape HW","url":"./40423128-1231-onshape-lian-gan-zu-zhuang-ying-pian.html"},{"title":"404231028 12/20 Solvespace 3D列印機作業","text":"範例3D列印機組裝影片 657457973 from Su Sam on Vimeo . 3D列印機 3D列印機零件 支柱 連接桿 底盤 圓盤 3D列印機Solvespace組裝影片 657488700 from Su Sam on Vimeo .","tags":"onshape HW","url":"./404231028-1220-solvespace-3dlie-yin-ji-zuo-ye.html"},{"title":"40423128 onshape分組作業","text":"onshape 每週作業 2016 11 09 15 42 09 596 from Su Sam on Vimeo . 2016 11 09 16 04 53 473 from Su Sam on Vimeo . 2016 12 12 15 46 31 396 from Su Sam on Vimeo . 2016 11 09 16 04 53 473 from Su Sam on Vimeo .","tags":"onshape HW","url":"./40423128-onshapefen-zu-zuo-ye.html"},{"title":"40423128 12/1作業","text":"40423128 12/1作業 Solvespace 組合圖","tags":"HW","url":"./40423128-121zuo-ye.html"},{"title":"40423128 11/24作業","text":"40423128 11/24作業 Solvespace 1. Parts (零件繪製) 範例檔案: http://solvespace.com/bracket.pl Extrude (平行長出或除料) STL 格式 範例:平行長出 STL 格式 範例:除料 Lathe (旋轉繞行長出或除料) Export Triangle Mesh STL 格式 three.js 2. Assembly (零件組立) 644401039 from Su Sam on Vimeo . 3. Linkages (fourbar & multilink) (四連桿與多連桿運動模擬) 4. Compiled & API (編譯與延伸應用) 使用 Virtualbox 虛擬主機執行 Windows 64 位元與 Ubuntu 64 位元環境中的編譯與延伸應用.","tags":"HW","url":"./40423128-1124zuo-ye.html"},{"title":"40423128 11/17作業 四連桿機構","text":"40423128 11/17作業 Solvespace 平面四連桿機構模擬 將所得到的點座標的.csv以Excel的畫圖，得到： 首先利用 Brython, 讀取 data 目錄中的 11117.csv 座標檔案, 然後以 splitlines() 及 split() 取出各點的 x 座標與 y 座標後, 將點連成路徑曲線如下: window.onload=function(){ brython(1); } from browser import document as doc from browser import html import math # 準備繪圖畫布 canvas = doc[\"fourbar\"] container1 = doc['container1'] ctx = canvas.getContext(\"2d\") fourbar_data = open(\"./../w7/11117.csv\").read() fourbar_list = fourbar_data.splitlines() #container1 <= fourbar_list[0] # 以下可以利用 ctx 物件進行畫圖 # 先畫一條直線 ctx.beginPath() # 設定線的寬度為 1 個單位 ctx.lineWidth = 1 # 利用 transform 將 y 座標反轉, 且 offset canvas.height # (X scale, X skew, Y skew, Y scale, X offset, Y offset) # 配合圖形位置進行座標轉換 ctx.transform(1, 0, 0, -1, canvas.width/2+250, canvas.height/2+100) # 畫出 x 與 y 座標線 # 各座標值放大 8 倍 ratio = 8 ''' ctx.moveTo(0, 0) ctx.lineTo(0, 100) ctx.moveTo(0, 0) ctx.lineTo(100, 0) ''' ctx.moveTo(0, 0) ctx.lineTo(-30*ratio, 0) start_point = fourbar_list[0].split(\",\") ctx.moveTo(float(start_point[0])*ratio, float(start_point[1])*ratio) count = 0 for data in fourbar_list[1:]: point = data.split(\",\") #count = count + 1 #container1 <= str(count) + \":\" + point[0] + \",\" + point[1] #container1 <= html.BR() ctx.lineTo(float(point[0])*ratio, float(point[1])*ratio) # 設定顏色為藍色, 也可以使用 \"rgb(0, 0, 255)\" 字串設定顏色值 ctx.strokeStyle = \"blue\" # 實際執行畫線 ctx.stroke() ctx.closePath()","tags":"HW","url":"./40423128-1117zuo-ye-si-lian-gan-ji-gou.html"},{"title":"40423128 上課筆記","text":"9/22筆記 網址:http://chiamingyen.github.io/kmolab/blog/index.html 下載網址:140.130.17.17(只能在學校裡使用) 2016fall裡的檔案倒數兩個擇一下載(ana2016fall_os(3.0g)or mini2016fall.7z(98m)) 1.創2016fallcadp_hw 將README打勾 格式:python 加密:agpl 新增gh-pages分支 進入setting 點branches 將master變更為gh-pages 點update 2.git clone 2016fallcadp_hw cd 2016fallcadp_hw git branch git checkout gh-pages git branch(再次檢查) 3.創 學號.github.io 將README打勾 格式:python 加密:agpl 點選create new file 打入index.html 點commit new file 4.創 2016fallcadp_ag100(組別) 將README打勾 格式:python 加密:agpl 將2016fallcadp_ag100 clone下來 cd 2016fallcadp_ag100 git branch git checkout gh-pages git branch(再次檢查) 將自己的2016fallcadp_hw clone網址複製 git submodule add -b gh-pages 網址 學號 git staus(檢查) 依序將隊友的資料夾加入 git add -A git commit -m \"名稱\" git push origin gh-pages 完成 9/29筆記 1.radinsed半徑 2.diameter直徑 3.place放置 4.symmetrically對稱 5.lnitially開始 6.oriented定位 7.axes軸 8.indicated表示 9.respectively分別 10.parallel平行 11.extruding長出 12.automatically自動 13.coincident一模一樣 14.constraint約束 15.horizontal橫 16.perpendicular垂直 17.step圖(格式) 錄影工具:sharex 1.paths 2.task → screen recorder → options 開始錄製:shift+ print screen 射出成型軟體:moldex3d 簡報:shower.js 10/6筆記 proxy設定:proxy.mde.tw 通訊阜:3128 去聲音指令:ffmpeg.exe -i 檔名 -c copy -an out.mp4 字幕指令:ffmpeg.exe -i out.mp4 -vf subtitles=in.srt out2.mp4 安裝pelican指令:pip install pelican","tags":"上課筆記","url":"./40423128-shang-ke-bi-ji.html"},{"title":"40423128 10/27作業","text":"40423128 10/27作業 心得:不僅可以分析簡易的四連桿運動的路線，更進階可繪出零件分析運動軌跡 Solvespace 四連桿圖檔&路徑: 40423128 w7.csv (請以滑鼠右鍵存檔) 40423128 w7.slvs (請以滑鼠右鍵存檔)","tags":"HW","url":"./40423128-1027zuo-ye.html"}]};